import React, { useState, useEffect } from 'react';
import StatisticsRow from './StatisticsRow';
import 'bootstrap/dist/css/bootstrap.min.css';

const Statistics = () => {
  const [seasonStats, setSeasonStats] = useState([]);

  // useEffect(() => {
  //   // Effectuer une requête vers l'URL du service web pour récupérer les statistiques de la saison
  //   fetch('URL_DU_WS')
  //     .then(response => response.json())
  //     .then(data => setSeasonStats(data))
  //     .catch(error => console.error('Erreur lors de la récupération des données:', error));
  // }, []); // Le tableau vide en tant que dépendance signifie que cet effet ne s'exécute qu'une fois après le montage du composant

  return (
    <div className="container mt-5">
      <h1 className="text-center mb-4">2023-2024 SAISON STATS</h1>
      <table className="table table-bordered table-striped">
        <thead className="table-dark">
          <tr>
            <th>CLASSEMENT</th>
            <th>JOUEUR</th>
            <th>ÉQUIPE</th>
            <th>M</th>
            <th>MJ</th>
            <th>PPM</th>
            <th>RPM</th>
            <th>PDPM</th>
            <th>MPM</th>
            <th>EFF</th>
            <th>FG%</th>
            <th>3P%</th>
            <th>%LF</th>
            <th>DÉSACTIVÉ</th>
            <th>DÉF</th>
            <th>IPM</th>
            <th>CPM</th>
            <th>BP</th>
            <th>FP</th>
          </tr>
        </thead>
        <tbody>
          {/* {seasonStats.map((playerStat, index) => (
            <StatisticsRow key={index} {...playerStat} />
          ))} */}
          <tr>
            <td> yes CLASSEMENT</td>
            <td> yes JOUEUR</td>
            <td> yes ÉQUIPE</td>
            <td> yes M</td>
            <td> yes MJ</td>
            <td> yes PPM</td>
            <td> yes RPM</td>
            <td> yes PDPM</td>
            <td> yes MPM</td>
            <td> yes EFF</td>
            <td> yes FG%</td>
            <td> yes 3P%</td>
            <td> yes %LF</td>
            <td> yes DÉSACTIVÉ</td>
            <td> yes DÉF</td>
            <td> yes IPM</td>
            <td> yes CPM</td>
            <td> yes BP</td>
            <td> yes FP</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
};

export default Statistics;
